import React from 'react';
import { Link } from 'react-router-dom';
import '../../styles/navbar.css';

function Navbar() {
  return (
    <nav style={{
      display: 'flex',
      justifyContent: 'space-between',
      alignItems: 'center',
      padding: '20px 40px',
      maxWidth: '1400px',
      margin: '0 auto',
      position: 'relative',
      zIndex: 10,
    }}>
      {/* Logo */}
      <Link to="/" style={{
        fontSize: '24px',
        fontWeight: 'bold',
        textDecoration: 'none',
        color: '#FFFFFF',
        display: 'flex',
        alignItems: 'center',
        gap: '8px'
      }}>
        <span style={{ color: '#5CE1E6' }}>DS</span>
        <span>Portfolio</span>
      </Link>

      {/* Navigation Links */}
      <div style={{
        display: 'flex',
        gap: '40px',
        alignItems: 'center'
      }}>
        <Link to="/projects" style={{
          color: '#FFFFFF',
          textDecoration: 'none',
          fontSize: '16px',
          transition: 'color 0.3s ease'
        }}>
          Projects
        </Link>
        <Link to="/analysis" style={{
          color: '#FFFFFF',
          textDecoration: 'none',
          fontSize: '16px',
          transition: 'color 0.3s ease'
        }}>
          Analysis
        </Link>
        <Link to="/models" style={{
          color: '#FFFFFF',
          textDecoration: 'none',
          fontSize: '16px',
          transition: 'color 0.3s ease'
        }}>
          Models
        </Link>
        <Link to="/contact" style={{
          color: '#FFFFFF',
          textDecoration: 'none',
          fontSize: '16px',
          transition: 'color 0.3s ease'
        }}>
          Contact
        </Link>
      </div>
    </nav>
  );
}

export default Navbar;
